All the Sweet Stuff
From Wikipedia, the free encyclopedia

Studio album by Gravy Train!!!!
Released: July 10, 2007
Genre: Electropop
Label: Cochon Records


All The Sweet Stuff is the third album from queercore band Gravy Train!!!!.

Track listing

   1. &quot;All The Sweet Stuff&quot;
   2. &quot;Wutcha Wutcha Wutcha Wutcha Wutcha Wutcha Doin' Tonite?&quot;
   3. &quot;Club Situation&quot;
   4. &quot;Solo J/O&quot;
   5. &quot;D.A.N.N.Y.&quot;
   6. &quot;The Hair Stare&quot;
   7. &quot;Strip 4 Me&quot;
   8. &quot;Just Listen&quot;
   9. &quot;Call Me In French&quot;
  10. &quot;Frat Party&quot;
  11. &quot;A Delicious Treat&quot;

---------------------------------------------------------------------------------

Sounds like: Yngwie Malmsteen, Joe Satriani


If you like it, buy it!				Comments are greatly appreciated :)
